const Header = ({ content, firstName, lastName, year }) =>
    (
        <header>
            <h1>{content}</h1>
            <h4>Teacher:{`${firstName} ${lastName}`}  </h4>
            <p>year: {year}</p>
        </header>
    )

export default Header;
